import React from 'react';
import './Style.css';
import { Tab } from 'bootstrap';

function Navbar() {
  return (
    <nav class="navbar">
      <ul>
        <il>
          <button type="button" class="btn btn-light">Light</button><Tab></Tab>
          <button type="button" class="btn btn-success">Light</button>
          <button type="button" class="btn btn-warning">Light</button>
        </il>
      </ul>
    </nav>
  );
}

export default Navbar;
